import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar';
import Services from './Components/Services';
import GalleryCarousel from './Components/GalleryCarousel';
import Authrization from './Components/Authorization';
import { ClientsFeetchData } from './Redux/Actions/actions';
import HowToFindUs from './Components/HowToFindUs';
import NewsCarousel from './Components/NewsCarousel';
import AuthModal from './Components/AuthenticationModal';

class App extends React.PureComponent {
  render() {
    return (
      <div className="App">
        <Header />
        <NavigationBar />
        <div className="main">
          <div className="main_window">
            <NewsCarousel />
            <GalleryCarousel />
            <Services />
            <HowToFindUs />
          </div>
        </div>

        <AuthModal />
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    employeeToken: state.employeeToken,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    fetchClient: (url) => dispatch(ClientsFeetchData(url)),
  };
}

export default connect(mapStateToProps, null)(App);
